import React, { useState } from 'react';
import Breadcrumb from './../components/widget/Breadcrumb';

const listsportfolio = [
	{
	 	id: 1,
		image: 'assets/img/portfolio/portfolio-1.jpg',
		type: 'App',
	},
	{
	 	id: 2,
		image: 'assets/img/portfolio/portfolio-2.jpg',
		type: 'Web',
	},
	{
	 	id: 4,
		image: 'assets/img/portfolio/portfolio-3.jpg',
		type: 'App',
	},
	{
	 	id: 4,
		image: 'assets/img/portfolio/portfolio-4.jpg',
		type: 'Card',
	},
	{
	 	id: 5,
		image: 'assets/img/portfolio/portfolio-5.jpg',
		type: 'Web',
	},
	{
	 	id: 6,
		image: 'assets/img/portfolio/portfolio-6.jpg',
		type: 'App',
	},
	{
	 	id: 7,
		image: 'assets/img/portfolio/portfolio-7.jpg',
		type: 'Card',
	},
	{
	 	id: 8,
		image: 'assets/img/portfolio/portfolio-8.jpg',
		type: 'Card',
	},
	{
	 	id: 9,
		image: 'assets/img/portfolio/portfolio-9.jpg',
		type: 'Web',
	}
];

function Portfolio() {
	const [filter, setFilter] = useState('*');
  const handleFilter = () => setFilter(!filter);
	return (
		<main id="main">
			<Breadcrumb page="Portfolio" description="Est dolorum ut non facere possimus quibusdam eligendi voluptatem. Quia id aut similique quia voluptas sit quaerat debitis. Rerum omnis ipsam aperiam consequatur laboriosam nemo harum praesentium." />

		  <section id="portfolio" className="portfolio">
		    <div className="container">

		      <div className="row">
		        <div className="col-lg-12 d-flex justify-content-center" data-aos="fade-up">
		          <ul id="portfolio-flters">
   							{
									listsportfolio.map(lsp => {
										if(!lsp.type) {
											<li handleFilter={() => setFilter(!filter)} className="filter-active">All</li>
										}
											<li>{lsp.type}</li>
										}
									)
								}
		          </ul>
		        </div>
		      </div>

		      <div className="row portfolio-container" data-aos="fade-up">

						{listsportfolio.map(lsp => (
		        <div key={lsp.id} className={`col-lg-4 col-md-4 portfolio-item filter-${lsp.type.toLowerCase()}`}>
		          <div className="portfolio-wrap">
		            <img src={lsp.image} className="img-fluid" alt="" />
		            <div className="portfolio-info">
		              <h4>{lsp.type} 1</h4>
		              <p>{lsp.type}</p>
		              <div className="portfolio-links">
		                <a href={lsp.image} data-gallery="portfolioGallery" className="portfolio-lightbox" title={`${lsp.type}`}><i className="bx bx-plus"></i></a>
		                <a href="portfolio-details" title="More Details"><i className="bx bx-link"></i></a>
		              </div>
		            </div>
		          </div>
		        </div>
 			   		))}

		      </div>
		    </div>
		  </section>

		</main>
	)
}
export default Portfolio;
